import { useNavigation, useRoute} from '@react-navigation/native';
import React, { Component,useState,useCallback } from 'react'
import { Text ,View,Image, Button, TouchableOpacity,StyleSheet,Dimensions,ScrollView, ImageBackground, FlatList} from 'react-native'
import { SafeAreaView } from 'react-navigation';
import helpIcon from '../assets/help.png';
import Camera from './Camera';
import { LinearGradient } from 'expo-linear-gradient';

import Back from '../assets/back.png';
import Png from '../assets/menuPng.png'
import Spotify from '../assets/spotify.png'
import Arrow from '../assets/Arrow.png'
import Rollback from '../assets/rollback.png'
import music from '../assets/music.png'
import Array from '../songData'
import { useFonts } from 'expo-font';
import sad from '../assets/sad.png'
import happy from '../assets/happy.png'


  export default function Menu () {

    const navigation = useNavigation();
    const height = Dimensions.get('window').height;
    const width = Dimensions.get('window').width;

    const route = useRoute();

    function img(){
        if(route.params.face == '悲しい'){
            console.log(route.params.face);
            return (
            <View>
                 <Image source={sad} style={styles.faceIcon}></Image>

            </View>
            )
        }
        else{
            return (
            <View style={{position: 'absolute',top:50}}>
                <Image source={happy} style={styles.faceIconHappy}></Image>
            </View>
            )
        }
    }
// if(route.params.face == '悲し'){
//         return <Image source={sad} style={{width:100, height:100}}/>
//     }


    return (
        <SafeAreaView
         style= {{flex:1}}>

            <LinearGradient
                start={{x: 0, y: 0.2}} end={{x: 0, y: 1}}
                // Background Linear Gradient
                colors={['#7979F2', '#FF76A1']}
                style={{position: 'absolute',
                left: 0,
                right: 0,
                top: 0,
                height:height}}
            />
            <ImageBackground
             source={Back} 
             style={{flex:1,alignItems: 'center'}}>

              <TouchableOpacity  
              style={{width:80,height:20,position:'absolute',top:80,left:20}} 
            onPress={()=>{navigation.navigate("Menu")}}>
                <Text style={{color:'white'}}>ホームへ戻る</Text>
              </TouchableOpacity>

              {route.params.image ? <Image source={{ uri: route.params.image }} style={{width:161,height:161,borderRadius:400,marginTop:90}}/> : null}
              {img()}
                <Text style={styles.decoration}>あなたの表情のカテゴリー :{route.params.face}</Text>
                <View style={styles.box}>
                    <Text style={{
                        marginTop:30,
                        marginBottom:20,
                        fontSize:18,
                        color:'#707070',}}>あなたに合う曲</Text>
                        <FlatList
                        data={Array}
                        renderItem={({item})=>(
                            <View>
                                <TouchableOpacity onPress={()=> navigation.navigate("MusicPlayer")} style={styles.ListBox}>
                                    {item.img ? <Image source={{ uri: item.img }} style={{
                                        width:50,
                                        height:50,
                                        marginRight:20}}/> : null}
                                    <View style={{justifyContent: 'center',}}>
                                        <Text style={styles.ListTitle}>{item.title}</Text>
                                        <Text style={styles.ListAt}>{item.at}</Text>
                                    </View>
                                </TouchableOpacity>
                            </View>
                        )}
                        keyExtractor={(item) => item.title}

                        />      
                    {/* <TouchableOpacity style={styles.rollTouch}>
                        <Text style={styles.rollText}>診断をやり直す</Text>
                        <Image source={Rollback} style={styles.rollback}></Image>
                    </TouchableOpacity> */}
                </View>
            </ImageBackground>
        </SafeAreaView>
    )
}   
const height = Dimensions.get('window').height;
const width = Dimensions.get('window').width;
const styles = StyleSheet.create({
    ListBox: {
        flexDirection: 'row',
        marginTop: 10
    },
    ListTitle: {
        fontSize:18,
        margin:2,
        color:'#707070',
    },
    ListAt:{
        fontSize:13,
        color: '#909090',
        margin:2
    },
    box:{
        width: width,
        height: height,
        backgroundColor: 'white',
        paddingTop:10,
        borderTopStartRadius:30,
        borderTopEndRadius:30,
        paddingLeft:30
    },
    faceImage:{
        flex:0.6,
        borderRadius:400,
        marginTop:120
    },
    decoration:{
        margin: 20,
        marginTop:16,
        color:'white',
        fontSize:16,
        fontWeight:'bold',
    },
    faceIcon:{
        width:30,
        height:50,
        position:'absolute',
        left:60,
        bottom:80
    },
    faceIconHappy:{
        width:200,
        height:200,

    },
    image: {
        width:173,
        height:173,
        backgroundColor:'gray',
        margin:20
    },
    artist:{
        margin:5
    },
    touch:{
        width:170,
        height:40,
        flexDirection: 'row',
        justifyContent: 'space-around',
        alignItems: 'center',
        position: 'relative',
        margin:10
    },
    arrow:{
        width:13,
        height:16,
        position: 'absolute',
        right: 30
    },
    touchText:{
        color: 'white',
        fontSize:13,
        fontWeight:'500'
    },
    rollTouch:{
        width:170,
        height:40,
        flexDirection: 'row',
        alignItems: 'center',
        position: 'relative',
        backgroundColor: 'white',
        borderColor:'#EF6DF4',
        borderWidth:2,
        borderRadius:22,
        paddingLeft:20,
        left:70,
        top:100
    },
    rollback:{
        width:22,
        height:22,
        position: 'absolute',
        right: 25
    }
    ,rollText:{
        color: '#EF6DF4',
        fontWeight:'400'
    }
})
